import React from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';

const MyShelf = () => {
    const { isAuthenticated, shelfContent } = useAuth();
    const navigate = useNavigate();

    if (!isAuthenticated) {
        // Перенаправляем на страницу авторизации, если пользователь не аутентифицирован
        navigate('/login');
        return null;
    }

    return (
        <div className="main-shelf">
            <h1>My Shelf</h1>
            <p>Here is your bookshelf content...</p>
            {/* Вывод информации о полке пользователя */}
            {shelfContent.map((book) => (
                <div key={book.id}>{book.title}</div>
            ))}
        </div>
    );
};

export default MyShelf;
